import React from 'react'

function Welcome() {
    return (
        <div className='box-start'>
            <h2><strong>Developer .Net(C#) | JavaScript</strong></h2>
            <h3><strong>Bienvenido</strong></h3>
            <p>
                Este portafolio muestra algunas de las cosas que realizado en base a lo que se, espero te guste.
            </p>
        </div>
    )
}

export default Welcome
